"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[1931],{1931:function(e){e.exports=JSON.parse('{"en":{"main_title":"Pieter Bruegel","name":"Pieter Bruegel","birthday_year":"1525","dead_year":"1569","description":"Pieter Brueghel the Elder - one of the largest representatives of the Flemish Renaissance. The most famous are his paintings and engravings of landscape and genre subjects. At an early age, Brueghel was apprenticed to the artist Pieter Krokke van Aelst. Already in 1551, when he was 26 years old, he was accepted into the painters\' guild in Antwerp."},"ua":{"main_title":"Пітер Брейгель","name":"Пітер Брейгель","birthday_year":"1525","dead_year":"1569","description":"Пітер Брейгель Старший – один із найбільших представників Фламандського Відродження. Найбільш відомі його картини та гравюри пейзажної та жанрової тематики. У ранньому віці Брейгеля віддали вчення до художника Пітера Крокке ван Альста. Вже в 1551, коли йому було 26 років, його прийняли в гільдію художників в Антверпені."},"es":{"main_title":"Pieter Bruegel","name":"Pieter Bruegel","birthday_year":"1525","dead_year":"1569","description":"Pieter Brueghel el Viejo - uno de los mayores representantes del Renacimiento flamenco. Los más famosos son sus pinturas y grabados de paisajes y temas de género. A una edad temprana, Brueghel fue aprendiz del artista Pieter Krokke van Aelst. Ya en 1551, cuando tenía 26 años, fue aceptado en el gremio de pintores de Amberes."}}')}}]);